// Navbar.jsx
import React from 'react';

function Navbar() {
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>Animals</li>
        <li>About US</li>
        <li>Home</li>
      </ul>
    </nav>
  );
}

export default Navbar;
